import React, { Component } from 'react';
import PostForm from './PostForm';

class Posts extends Component {
    componentDidMount() {
        this.props.getPosts();
    }

    render() {
        return (
            <div className="feed">
                <div className="container">
                    <div className="row">
                        <div className="col-md-12">
                            <PostForm />
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Posts;
